INSERT INTO `noticia` VALUES (18,'Reuni√≥n d√≠a lunes','Reuni√≥n d√≠a lunes a las 18:00hrs','2024-10-28 14:52:53',21,3351),(20,'Reuni√≥n de Junta de Vecinos','Se convoca cordialmente a todos los vecinos a participar en una reuni√≥n de la junta de vecinos, donde se abordar√°n temas de gran importancia para nuestra comunidad. Entre los puntos a tratar se encuentran las mejoras en la seguridad del vecindario, el mantenimiento de √°reas comunes y la planificaci√≥n de nuevos proyectos que beneficiar√°n a todos los residentes. Esta es una oportunidad para compartir opiniones, sugerencias y trabajar en conjunto por un entorno m√°s seguro y agradable para todos. La reuni√≥n se llevar√° a cabo el d√≠a 20 de noviembre a las 18:00 en el sal√≥n comunal. Se agradece la asistencia de todos los vecinos interesados en contribuir al bienestar de nuestra comunidad.','2024-11-20 18:00:00',22,3351),(31,'Nuevo Proyecto de Renovaci√≥n Urbana','Hoy, la municipalidad ha anunciado el lanzamiento de un nuevo proyecto de renovaci√≥n urbana en el centro de la ciudad. El proyecto busca mejorar las infraestructuras viales, crear nuevos espacios verdes y ofrecer mejores servicios a la comunidad. La iniciativa comenzar√° en el mes de enero de 2025 y se espera que dure aproximadamente dos a√±os.','2024-11-19 02:19:31',42,3351);
