INSERT INTO `proyecto` VALUES (8,'PROYECTO DE PRUEBA DE VECINO','Duraci√≥n del Proyecto: 6 meses\n\nPresupuesto Estimado: $5,000,000 CLP\n\n1. Introducci√≥n\n\nEl proyecto de la Junta de Vecinos \"Barrio Verde\" se propone mejorar la cohesi√≥n social y el bienestar de la comunidad, fortaleciendo las redes de apoyo vecinal y optimizando los espacios comunes del sector. Este proyecto responde a la necesidad de contar con √°reas recreativas seguras y bien mantenidas, adem√°s de actividades que impulsen la participaci√≥n ciudadana en el cuidado del entorno y el fortalecimiento de los v√≠nculos vecinales.\n\n2. Objetivos del Proyecto\n\nObjetivo General: Fortalecer la participaci√≥n ciudadana en el barrio mediante actividades comunitarias y mejoras en espacios comunes.\n\nObjetivos Espec√≠ficos:\n\nRealizar talleres y capacitaciones que fomenten el sentido de pertenencia y la participaci√≥n activa de los vecinos.\nRehabilitar √°reas comunes como plazas, parques y zonas de esparcimiento.\nImplementar un sistema de comunicaci√≥n interna y notificaciones para informar a los vecinos sobre actividades y noticias de la comunidad.\n3. Justificaci√≥n\n\nEste proyecto nace de la preocupaci√≥n por el deterioro de espacios comunes y la falta de interacci√≥n comunitaria. Al fomentar un entorno de respeto y colaboraci√≥n, se espera mejorar tanto la calidad de vida de los residentes como la seguridad y cuidado de los espacios p√∫blicos. Adem√°s, mediante la publicaci√≥n de noticias y actividades, se busca mantener informados a los vecinos y motivarlos a participar activamente en las decisiones del barrio.\n\n4. Actividades\n\nCapacitaciones y Talleres: Cursos de jardiner√≠a, reciclaje, primeros auxilios y seguridad vecinal, a fin de empoderar a los residentes en temas relevantes para la comunidad.\n\nRehabilitaci√≥n de Espacios: Pintura y limpieza de plazas y parques, instalaci√≥n de mobiliario urbano, y creaci√≥n de murales comunitarios.\n\nSistema de Comunicaci√≥n Comunitaria: Desarrollo de una plataforma digital para la publicaci√≥n de noticias, notificaciones y eventos relevantes para el barrio, permitiendo una comunicaci√≥n m√°s eficiente y oportuna.\n\n5. Recursos Necesarios\n\nHumanos: Voluntarios, t√©cnicos en rehabilitaci√≥n de espacios, facilitadores de talleres, y un desarrollador para la plataforma digital.\n\nMateriales: Pintura, herramientas de jardiner√≠a, mobiliario urbano (bancas, papeleras, juegos infantiles), materiales de construcci√≥n para mejoras menores en los parques.\n\nEcon√≥micos: Fondos municipales o patrocinio de empresas locales para cubrir los costos de materiales y personal t√©cnico.\n\n6. Cronograma\n\nMes 1-2: Planificaci√≥n y preparaci√≥n de los recursos necesarios, selecci√≥n de espacios y talleristas.\nMes 3-4: Implementaci√≥n de talleres y capacitaciones, inicio de las mejoras en los espacios comunes.\nMes 5: Finalizaci√≥n de mejoras en los espacios, implementaci√≥n del sistema de comunicaci√≥n.\nMes 6: Evaluaci√≥n de los resultados y cierre del proyecto.\n7. Resultados Esperados\n\nIncremento en la participaci√≥n de vecinos en actividades comunitarias.\nMejora en el estado de los espacios comunes, convirti√©ndolos en √°reas seguras y atractivas.\nComunicaci√≥n efectiva y continua entre la Junta de Vecinos y la comunidad.\n8. Indicadores de √âxito\n\nCantidad de vecinos participantes en las actividades y capacitaciones.\nNiveles de satisfacci√≥n con las mejoras en los espacios comunes.\nFrecuencia y alcance de las notificaciones y noticias compartidas en la plataforma comunitaria.\nConclusi√≥n\n\nEl Programa de Fortalecimiento Comunitario y Mejoramiento del Espacio Com√∫n busca consolidar un barrio unido y seguro, donde los vecinos se sientan valorados y motivados a cuidar su entorno. Con la colaboraci√≥n de todos, este proyecto ser√° una base s√≥lida para futuras iniciativas de desarrollo y bienestar comunal.',3334,31,1,'2024-11-02 17:00:08','PROYECTO RECHAZADO TEST 5','2024-11-02 17:33:15','','',0,''),(10,'Remodelaci√≥n sede','Hay que remodelar el techo por las lluvias...',3351,38,1,'2024-11-04 17:55:40',NULL,NULL,'Sede','$1.500.000',2,'Remodelar el techo'),(11,'Remodelaci√≥n sede 2','Hay que remodelar de nuevo',3351,39,1,'2024-11-04 17:57:41','No vale la pena','2024-11-04 18:00:57','Sede','$1.500.000',2,'Remodelar el techo de nuevo');
